import React, { Component } from 'react'

import Header from './components/Header';
import "./style.css";

function App(){

    <div className="App">
      <Header />
      <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>

};
setInterval(App, 1000);
export default App;
